import styles from './projects_items.module.css'
import dynamic from 'next/dynamic'
import { useMotionValue, useTransform } from 'framer'

const Stack = dynamic(
    () => import('framer').then((mod) => mod.Stack),
    { ssr: false }
  )

const Frame = dynamic(
  () => import('framer').then((mod) => mod.Frame),
  { ssr: false }
)

const Carrusel = dynamic(
  () => import('../carrusel/carrusel').then((mod) => mod.Carrusel),
  { ssr: false }
)

const Rail = dynamic(
  () => import('../rail/rail').then((mod) => mod.Rail),
  { ssr: false }
)



export default function ProjectsItems() {
    const position = useMotionValue(0);

    return ( 
        <div> 

          <Carrusel></Carrusel>

          <Rail></Rail>

        </div>
    );
}
